import React from 'react';


class Entry extends React.Component{
    render(){

        const{date, description, withdrawal, deposit, balance} =this.props

        return(
            <div>

                <h1>Entries</h1>
                <h2>{date}</h2>
                <h2>{description}</h2>
                <h2>{withdrawal}</h2>
                <h2>{deposit}</h2>
                <h2>{balance}</h2>


            </div>
        )

    }

}

export default Entry;
